import React from 'react';
import '../style/intro.scss';

const Intro = () => {
  return (
    <aside className="intro">
      <div className="intro__img">
        <img src="" alt="" />
      </div>
      <p className="intro__text">
        Personal Blog by Jia Song
      </p>
    </aside>
  )
}

export default Intro;
